import React from 'react';

import {
  Container,
  Title,
  Wrapper,
  InfoContainer,
  WorldIcon,
  UsersIcon,
  LanguagesIcon,
  InfoDescription,
  InfoTitle,
  EuropeContainer,
  EuropeImage,
  InfoWrapper,
} from './styles';

const SessionFour: React.FC = () => {
  return (
    <Container>
      <Title>Where is toSupply at?</Title>
      <Wrapper>
        <InfoContainer>
          <WorldIcon />
          <InfoWrapper>
            <InfoTitle>More than 10 countries in Europe</InfoTitle>
            <InfoDescription />
          </InfoWrapper>
        </InfoContainer>
        <EuropeContainer>
          <EuropeImage />
        </EuropeContainer>
      </Wrapper>
    </Container>
  );
};

export default SessionFour;
